// 生成一点随机音序
$.example = [...new Array(rand(10, 100))].map(() => {
  const t = random(0, 5), l = random(0.1, 1), n = rand(0, 100)
  return [{ event: "start", note: n , time: t }, { event: "stop", note: n , time: t + l }]
})

const nodes = {}
for (let i = 0, l = example.length; i < l; i++) {
  const { event, freq, time } = example[i]
  const t = time + ctx.currentTime
  if(event === "start") {
    nodes[freq]?.(t)
    nodes[freq] = createsound(freq, t)
  } else if (event === "stop") {
    nodes[freq]?.(t)
    delete nodes[freq]
  }
}
